import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";
import moment from "moment";
function App() {
  const nameList = [
    {
      id: 1,
      name: {
        title: "Mr",
        first: "Brad",
        last: "Gibson",
      },
      location: {
        city: "kilcoole",
      },
      email: "brad.gibson@example.com",
      dob: {
        date: "1993-07-20T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/men/75.jpg",
      },
    },

    {
      id: 2,
      name: {
        title: "Mrs",
        first: "Brie",
        last: "Larson",
      },
      location: {
        city: "New York",
      },
      email: "brie.larson@example.com",
      dob: {
        date: "1990-08-23T01:14:28.374Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/women/3.jpg",
      },
    },

    {
      id: 3,
      name: {
        title: "Miss",
        first: "Lee",
        last: "Hang",
      },
      location: {
        city: "Wuhan",
      },
      email: "emaly.blunt@example.com",
      dob: {
        date: "1987-12-22T01:14:28.374Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/women/17.jpg",
      },
    },

    {
      id: 4,
      name: {
        title: "Mr",
        first: "Chris",
        last: "Hemswarth",
      },
      location: {
        city: "Miami",
      },
      email: "chris.hemswarth@example.com",
      dob: {
        date: "1988-01-01T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/men/26.jpg",
      },
    },
  ];

  const nameListComponent = () => {
    return nameList.map((card) => {
      return (
        <ListItem
          key={card.id}
          name={`${card.name.title} ${card.name.first} ${card.name.last}`}
          city={card.location.city}
          email={card.email}
          birthday={moment(card.dob.date).format("L")}
          avatar={card.picture.medium}
        />
      );
    });
  };

  return (
    <React.Fragment>
      <div className="PageColor">
        <h1 className="Title">The Card List</h1>
        <div className="Page">{nameListComponent()}</div>
      </div>
    </React.Fragment>
  );
}

export default App;
